import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div style={{ 
        padding: '40px', 
        textAlign: 'center', 
        backgroundColor: 'red',
        color: 'white',
        minHeight: '100vh',
        fontFamily: 'Arial, sans-serif',
        fontSize: '24px',
        fontWeight: 'bold'
      }}>
        <h1 style={{ border: '5px solid yellow', padding: '20px' }}>
          üö® IT SUPPORT SYSTEM - CAN YOU SEE THIS? üö®
        </h1>
        <p style={{ backgroundColor: 'black', padding: '10px', margin: '20px 0' }}>
          If you can see this red page with white text, React is working!
        </p>
        
        <nav style={{ 
          margin: '30px 0', 
          padding: '15px',
          backgroundColor: 'blue',
          borderRadius: '10px'
        }}>
          <Link 
            to="/" 
            style={{ 
              color: 'yellow', 
              margin: '0 20px', 
              textDecoration: 'none',
              fontSize: '20px',
              border: '2px solid yellow',
              padding: '10px'
            }}
          >
            HOME
          </Link>
          <Link 
            to="/test" 
            style={{ 
              color: 'yellow', 
              margin: '0 20px', 
              textDecoration: 'none',
              fontSize: '20px',
              border: '2px solid yellow',
              padding: '10px'
            }}
          >
            TEST PAGE
          </Link>
        </nav>

        <Routes>
          <Route path="/" element={
            <div style={{ 
              padding: '30px', 
              backgroundColor: 'green', 
              borderRadius: '10px',
              border: '5px solid white'
            }}>
              <h2>üè† HOME PAGE</h2>
              <p>This should be very visible with green background!</p>
            </div>
          } />
          <Route path="/test" element={
            <div style={{ 
              padding: '30px', 
              backgroundColor: 'purple', 
              borderRadius: '10px',
              border: '5px solid white'
            }}>
              <h2>üß™ TEST PAGE</h2>
              <p>This should be very visible with purple background!</p>
            </div>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
